import "./RecordList.css";
import CalorieRecord from "./CalorieRecord";

import style from ".";

const RecordList = (props) => {
  return (
    <List>
      {
        props.records.map((record) =>
          record.calories >= 0 ? (
            <listItem key={record.id}>
              <CalorieRecord
                date={record.date}
                meal={record.meal}
                content={record.content}
                calories={record.calories} />
            </listItem>
          ) : null
        )}
    </List>
  );
}

export default RecordList;
